const Section: React.FC<SectionProps> = ({
    label,
    icon: Icon,
    open,
    toggle,
    children,
    openSideBar
}) => {
    const sectionRoutes: Record<string, string[]> = {
        "Wallet & Treasury": ["/overview", "/WalletMonitoring", "/FundMovement"],
        "Derivatives Module": ["/Tradingpairs", "/ProductContact"],
        "User Management": ["/AllUsers", "/FlaggedUsers"],
    };
    const isActive =
        sectionRoutes[label]?.some((path) =>
            location.pathname.startsWith(path)
        ) ?? false;

    return (
        <div className="w-full">
            <button
                onClick={() => toggle(label)}
                className={`flex items-center justify-between w-full gap-2 p-2 text-sm font-medium rounded-lg transition-all duration-300
                      ${isActive
                        ? "bg-[#EFF8FF] text-[#1570EF]"
                        : "bg-transparent text-[#535862] hover:bg-gray-100"
                    }
               `}
            >
                <p className="flex items-center gap-2">
                    <Icon size={18}
                        className={isActive ? " text-[#1570EF]" : "text-[#535862]"}
                    />   <p className={`${openSideBar ? 'hidden' : 'block'}`}>
                        {label}
                    </p>
                </p>
                {open ? (
                    <ChevronDown size={16} className="transition-transform duration-400 rotate-180" />
                ) : (
                    <ChevronRight size={16} className="transition-transform duration-400" />
                )}
            </button>


            <div
                className={`
                overflow-hidden transition-all duration-700 ease-in-out
                ${open ? "max-h-40 opacity-100" : "max-h-0 opacity-0"}
            `}
            >
                <div className={`mt-2 flex ml-2  flex-col ${openSideBar ? 'border-s-0 ' : '  border-s-2'}   text-sm text-gray-600 origin-top animate-slideDown`}>
                    {children}
                </div>
            </div>
        </div>
    );

}


interface SubItemProps {
    label: string;
    link: string;
    icon?: React.ComponentType<{ className?: string }>;
    openSideBar?: boolean;
}

const SubItem: React.FC<SubItemProps> = ({
    label,
    link,
    icon: Icon,
    openSideBar,
}) => {
    const location = useLocation();

    const isActive = location.pathname.startsWith(link);

    return (
        <Link
            to={link}
            className={`flex items-center gap-2 py-1 ${openSideBar ? 'ml-0 ' : 'ml-7'}  text-sm text-gray-600 hover:text-gray-900 transition-all duration-300`}
        >
            {Icon && openSideBar ? (
                <Icon className="w-4 h-4 text-gray-500" />
            ) : (
                <span
                    className={`whitespace-nowrap ${isActive ? "text-[#1570EF]" : "text-[#535862]"
                        } hover:text-[#1570EF]`}
                >
                    {label}
                </span>
            )}
        </Link>
    );
};


